import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class StudentService {

    students_details = [
      { name: 'Marcus', id:'1', balance: 0 },
      { name: 'Erik', id:'2',balance: 2500 },
      { name: 'Teetoh', id:'3', balance: 5000 },
      { name: 'Angela', id:'4', balance: 1000 }
    ];

    constructor(private studentService: StudentService) {}


  getStudents() {
    return this.students_details;
  }
}
